CREATE TABLE TFSDB2S.REF_GLMAPPING(
	GL_MAP_ID BIGINT NOT NULL GENERATED ALWAYS AS IDENTITY (START WITH 1 INCREMENT BY 1),
	ACCOUNTINGCODE VARCHAR(100),
    PARTICULARS VARCHAR(100),
	BOOKCODE VARCHAR(255),
	BOOKCURRENCY VARCHAR(255),
	LBP_ACCOUNTINGCODE VARCHAR(100),
	LBP_PARTICULARS VARCHAR(5000),
	PRIMARY KEY(GL_MAP_ID)
);


-- REMOVE DUPLICATES
DELETE FROM TFSDB2S.REF_GLMAPPING
WHERE GL_MAP_ID NOT IN (
	SELECT MIN(GL_MAP_ID) FROM TFSDB2S.REF_GLMAPPING
	GROUP BY ACCOUNTINGCODE, BOOKCODE, BOOKCURRENCY
	ORDER BY COUNT(*) DESC
);
